import React, { useEffect, useState } from "react";
import axios from "axios";
import styles from "./BlockAdmins.module.css"; // Optional CSS module

const BlockAdmins = () => {
  const [admins, setAdmins] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");

  const block = localStorage.getItem("block");

  useEffect(() => {
    axios
      .get(`http://localhost:8080/users/block/${block}`)
      .then((response) => {
        // Filter only users with role 'admin'
        const adminUsers = response.data.filter((user) => user.role === "admin");
        setAdmins(adminUsers);
        setLoading(false);
      })
      .catch((err) => {
        setError("Failed to fetch admin users.");
        setLoading(false);
      });
  }, [block]);

  if (loading) {
    return <p>Loading admin users...</p>;
  }

  if (error) {
    return <p>{error}</p>;
  }

  return (
    <div className={styles.container}>
      <h2>Admins in Block {block}</h2>
      {admins.length === 0 ? (
        <p>No admin users found in this block.</p>
      ) : (
        <table className={styles.table}>
          <thead>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Mobile</th>
              <th>Role</th>
            </tr>
          </thead>
          <tbody>
            {admins.map((admin) => (
              <tr key={admin.userId}>
                <td>{admin.userName}</td>
                <td>{admin.email}</td>
                <td>{admin.mobileNo}</td>
                <td>{admin.role}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default BlockAdmins;
